import React, { Component } from "react";
import Navbar from '../navbar/navbar'
import './showUsers.css'
class showUsers extends Component{
    render(){
        return(
            <div>
              <div>
                <Navbar/>
                </div>  
                <div>
                    USERS
                </div>
            </div> 
        )
    }

}
export default showUsers;
